INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (47,'Published','protein-turnover assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000045','Quantifies the protein turnover, which is a natural phenomenon in healthy cells, but becomes aberrant in diseased cells. The protein that is needed to be degraded first undergoes ubiquitination. Ubiquitinated proteins are degraded in the proteasome complex, and that degradation is quantitated by using reporters, such as green fluorescent protein, as proteasome substrates.',null,null,'Ready',0,{ts '2012-08-26 13:15:41.0'},{ts '2012-08-26 13:53:14.0'},'pclemons',null,'none','no');
