INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (68,'Published','conformation determination method',null,'conformation determination','http://www.bard.nih.gov/ontology/bard#BARD_0000066','Assay method that uses technology to measure protein and nucleic acid conformational properties. Proteins undergo changes to their tertiary structure upon heating or binding to perturbagens, other proteins, and substrates. Nucleic acids have characteristic secondary structures, which include the B-family of structures, A-form, Z-form, guanine quadruplexes, cytosine quadruplexes, triplexes, etc. Information about conformational properties of protein and nucleic acids can be obtained by several methods, including circular dichroism spectroscopy, thermal shift, fluorescence resonance energy transfer (FRET), nuclear magnetic resonance (NMR), and X-ray crystallography.',null,null,'Ready',0,{ts '2012-08-26 13:15:42.0'},{ts '2012-08-26 13:53:15.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (69,'Published','cytokine quantitation method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000067','Assay method thatallows direct detection of PCR-product formation by measuring the increase in fluorescent emission continuously during the PCR reaction.',null,null,'Ready',0,{ts '2012-08-26 13:15:42.0'},{ts '2012-08-26 13:53:15.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (70,'Published','enzyme activity measurement method',null,'enzyme activity meas method','http://www.bard.nih.gov/ontology/bard#BARD_0000068','Assay method that uses technology to measure an enzyme''s activity, either directly or by coupling to a secondary signal.',null,null,'Ready',0,{ts '2012-08-26 13:15:42.0'},{ts '2012-08-26 13:53:15.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (71,'Published','gene-expression detection method',null,'gene-expr detection','http://www.bard.nih.gov/ontology/bard#BARD_0000069','Assay method where technology is used to quantify the expression level of the entire gene pool in a cell or a subpopulation (e.g., tissue-specific gene expression, kinases pool, etc.) using one of the three methods: microarray, bead based method or RNASeq.',null,null,'Ready',0,{ts '2012-08-26 13:15:42.0'},{ts '2012-08-26 13:53:16.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (72,'Published','membrane potential measurement method',null,'membrane potential meas.','http://www.bard.nih.gov/ontology/bard#BARD_0000070','Assay method that uses technology to measure the difference in voltage between the interior and exterior of the cell. Electrically active cells, such as neurons, muscle and endocrine cells undergo changes in membrane potential due to depolarization and hyperpolarization as a result of opening and closing of ion channels. Action potentials are used to transmit signals across neurons, and in muscle and endocrine cells, they lead to intracellular events, such as muscle contraction and hormone release, respectively. In addition, mitochondria possess transmembrane potentials as a result of their respiratory function. Membrane potential can be measured either by using electrophysiological techniques or by staining with a dye whose binding is dependent on the membrane potential.',null,null,'Ready',0,{ts '2012-08-26 13:15:43.0'},{ts '2012-08-26 13:53:16.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (73,'Published','molecular interaction assessment method',null,'molecular interaction assess.','http://www.bard.nih.gov/ontology/bard#BARD_0000071','A type of assay method where covalent interactions hold the atoms of biopolymers and small molecules together.',null,null,'Ready',0,{ts '2012-08-26 13:15:43.0'},{ts '2012-08-26 13:53:16.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (74,'Published','morphology assessment method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000072','Assay method that uses technology, detected by microscopy, to measure how the shape and form of molecules affect their chemical properties, dynamic reconfiguration and interactions.',null,null,'Ready',0,{ts '2012-08-26 13:15:43.0'},{ts '2012-08-26 13:53:16.0'},'pclemons',null,'element','RDM request');
