INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (187,'Published','reporter-gene method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000185','Technology that uses an inducible reporter gene to study the effects of perturbagens on gene expression. Some reporter genes can be easily detected, e.g., green fluorescence protein, and others function as selectable markers, e.g., antibiotic resistance.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:21.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (188,'Published','serial analysis of gene expression',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000186','Serial analysis of gene expression (SAGE) is a technique used to produce a snapshot of the messenger RNA population in a sample of interest in the form of small tags that correspond to fragments of those transcripts.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:21.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (189,'Published','dye-binding method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000187','Technology that measures the delta-psi (mitochondrial membrane potential) by staining with specific dyes whose binding is dependent on the potential.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:21.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (190,'Published','electrophysiological method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000188','Technology that measures changes in membrane potential via opening and closing of ion channels in electrically active cells (such as neurons, muscle cells, and endocrine cells) by the insertion or attachment of microelectrodes. Patch clamp, voltage clamp, and current clamp are three ways of studying the current-voltage relationships of the ion channels.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:21.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (191,'Published','binding assessment method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000189','Technology is used to quantitate the interactions between two molecules, e.g., perturbagen-protein, protein-protein, protein-DNA, etc. Methods used include radioligand binding, resonance energy transfer, fluorescence polarization, protein fragment complementation assay, and several label-free methods, as well as surface plasmon resonance, impedance, nuclear magnetic resonance, X-ray diffraction, isothermal titration calorimetry, and mass spectrometry.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:21.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (192,'Published','in situ immunoassay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000190','Examines an antigen that is undisturbed or in place/position; protein detection and localization is achieved by visualization under a microscope.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (193,'Published','acetylation assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000191','Assay type that involves a reaction to add an acetyl group to a chemical compound or molecule, usually to a protein or peptide and impacting gene expression and metabolism',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (194,'Published','methylation assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000192',null,null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (195,'Published','phosphorylation assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000193','Quantifies the phosphorylation levels of a protein. The phosphorylation status is detected by one of several methods: using phosphorylation specific antibodies followed by western blotting or imaging, mass spectrometry, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (196,'Published','protein complex format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000194','Assay format in which the perturbagen targets stable complexes of two or more proteins.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (197,'Published','single protein format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000195','Assay format in which the perturbagen targets one protein sequence to regulate its function.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (198,'Published','dye redistribution',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000196','Used to study flux of molecules across membranes, e.g., calcein AM, ethidium homodimer-1, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (199,'Published','ion redistribution',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000197','Used to study ion channel activity by chemically initiating the opening of channels in the presence of a fixed amount of radiolabeled cation or anion, and a potential ion channel modulator compound.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (200,'Published','metal ion redistribution',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000198','Used to study the way metal ions such as copper, iron, magnesium and zinc are transported between different cellular compartments to bring about specific functions. This is regulated by their influx and efflux across membranes, which could occur either by passive diffusion or active transport.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (201,'Published','protein redistribution',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000199','Used to study how cellular signaling brings about the movement of proteins in cells. Upon receiving a cue, proteins undergo posttranslational modifications, e.g., phosphorylation, dephosphorylation, etc., which results in their activation and migration to different compartments, often to the nucleus, where they regulate gene expression.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (202,'Published','second messenger redistribution',null,'2nd messenger redistrib.','http://www.bard.nih.gov/ontology/bard#BARD_0000200','Used to study how second messengers relay and amplify signals from the receptors to the cell interior as part of a signaling event. Examples include cAMP, cGMP, calcium, nitric oxide, diacylglycerol, etc., which play important roles in different physiological processes.',null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (203,'Published','signal decrease corresponding to activation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000201',null,null,null,'Ready',0,{ts '2012-08-26 13:15:49.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
