INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (209,'Published','cell membrane format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000207','Assay format in which the perturbagen targets extracted cell membrane to regulate its function.',null,null,'Ready',0,{ts '2012-07-02 15:18:02.0'},{ts '2012-08-26 13:53:22.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (210,'Published','cytosol format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000208','Assay format in which the perturbagen targets the fluid component of cytoplasm (cytosol) obtained by cell lysis and fractionation.',null,null,'Ready',0,{ts '2012-07-02 15:18:02.0'},{ts '2012-08-26 13:53:22.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (211,'Published','microsome format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000209','Assay format in which the perturbagen targets microsomes formed as an artifact from the endoplasmic reticulum after the cell has been ruptured by homogenization.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (212,'Published','mitochondrion format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000210','A type of assay format in which the perturbgen targets mitochondria obtained by cell lysis and fractionation.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:22.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (213,'Published','nuclear extract format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000211','Assay format in which the perturbagen targets nuclear extract obtained by cell lysis and fractionation.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (214,'Published','nucleosome format',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000212','Assay format in which the perturbagen targets nucleosomes obtained by cell lysis and fractionation.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (215,'Published','ATP quantitation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000213','ATP levels are an indicator of viable cell number. ATP levels higher than controls (untreated cells) indicate proliferation and ATP levels lower than controls indicate cytotoxicity. ATP can be quantified using different commercial kits.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (216,'Published','caspase activity determination',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000214','Caspase levels are an indicator of the degree of apoptosis happening in cells in a sample, and caspase levels higher than controls indicate cytotoxicity. Caspase levels can be quantified using different commercial kits.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (217,'Published','cell number determination',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000215','Cells are counted to determine their viability. Cultured animal cells are counted either manually using hemocytometer or by an automated cell counter, e.g., Coulter counter or Vi-CELL. The automated counter can distinguish live and dead cells by the trypan blue cell exclusion method. Yeast and bacterial cell growth is determined by measuring absorbance in a spectrophotometer or by viable plate count.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (218,'Published','chromatin condensation visualization',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000216','Visualizes the chromatin condensation morphological changes (also known as pyknosis) that occur during apoptosis by microscopic examination of dye staining.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (219,'Published','dehydrogenase activity determination',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000217','An expansion in the number of viable cells results in an increase in the overall activity of mitochondrial dehydrogenases in the sample. The internal environment of the proliferating cell is more reduced than that of non-proliferating cells; specifically, the ratios of NADPH/NADP+, FADH/FAD+, FMNH/FMN+, and NADH/NAD+ increase during proliferation. Compounds such as tetrazolium salts and Alamar Blue, which can be reduced by these metabolic intermediates, can be used to monitor cell proliferation. Their reduction is accompanied by a measurable shift in wavelength with a corresponding change in color.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (220,'Published','DNA content estimation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000218','Cell nuclei can be by stained with Hoechst, DAPI, etc., and the depth of staining indicates the DNA content, which can be used as a measure of cell viability and proliferation.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (221,'Published','esterase activity determination',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000219','Cell viability can be assessed by the presence of cytoplasmic esterases that cleave a lipid-soluble nonfluorescent probe to yield a fluorescent product. The product is charged and is thus retained within the cell if the membrane is intact. Typical probes include fluorescein diacetate (FDA), carboxyfluorescein, and calcein.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (222,'Published','membrane permeability assessment',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000220','Live cells with intact membranes have the ability to exclude dyes that easily penetrate dead or damaged cells. Examples of the dyes include propidium iodide, 7-amino actinomycin D, and trypan blue. Cells stained with the former two can be quantified by flow cytometry, while the latter is quantified by manual counting using hemocytometer.',null,null,'Ready',0,{ts '2012-08-26 13:15:50.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (223,'Published','mitochondrial membrane potential assessment',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000221','Activity of the mitochondrial respiratory chain results in the generation of a proton gradient that consists of two components: a membrane potential and a pH gradient. Disruption of delta-psi (mitochondrial membrane potential) has been shown to be one of the first intracellular changes following the onset of apoptosis. Delta-psi is generally quantified by staining with specific dyes whose binding is dependent on the potential and, less commonly, by electrophysiological techniques.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (224,'Published','phospholipid redistribution estimation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000222','In a viable cell, phosphatidyl serine (PS), a phospholipid, is located on the inner leaflet of the cell membrane facing the cytosol. When the cell is undergoing apoptosis, the cell membrane loses its phospholipid asymmetry and exposes PS on the outer layer of the membrane. Apoptotic cells can be detected by staining with fluorescein isothiocyanate (FITC)-conjugated Annexin V, which specifically binds PS, followed by flow cytometry.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (225,'Published','protease activity determination',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000223','Live cells have a conserved and constitutive protease activity that serves as a biomarker of cell viability. The live-cell protease activity is measured using a fluorogenic, cell-permeant, peptide substrate (Gly-Phe-AFC). The substrate enters intact cells, where it is cleaved by the live-cell protease activity to generate a fluorescent signal proportional to the number of living cells. The live-cell protease becomes inactive upon loss of membrane integrity and leakage into the surrounding culture medium.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (226,'Published','nucleic acid array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000224','Nucleic acids (either DNA or RNA) are immobilized by spotting on a solid support, such as a glass slide, and are hybridized with labeled nucleic acids from a sample. The measured signals reflect the composition of the sample''s nucleic acids, and quantifies gene expression under various conditions, e.g., diseases, development, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (227,'Published','protein array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000225','Purified proteins, cell or tissue lysates, antibodies, or peptides are immobilized by spotting on a solid support, such as a glass slide, in order to quantify the proteome or study protein-protein, protein-DNA, protein-small molecule interactions, and enzyme activity.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (228,'Published','small-molecule array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000226','Small molecules that are either natural or synthetic are immobilized by robotic printing on a solid support, such as a functionalized glass slide. Protein targets, either purified or from a lysate, are hybridized to the immobilized small molecules in an attempt to identify the natural ligands for proteins and molecules that might regulate their function.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (229,'Published','background control',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000227','The readings obtained from wells to which the sample or one of the reagents was not added. This is subtracted from all the experimental readings prior to further analysis. Depending on the composition of the inhibitor stocks, DMSO might be needed in the control wells to assure consistency across all the experiments.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (230,'Published','high-signal control',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000228','Contains the substrate titration without inhibitor to reflect the maximum enzyme activity at each substrate concentration. Depending on the composition of the inhibitor stocks, DMSO might be needed in the control wells to assure consistency across all the experiments.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (231,'Published','low-signal control',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000229','Contains the substrate titration without enzyme or substrate and without inhibitor. The low controls should reflect the signal expected for no enzyme activity at each substrate concentration. Depending on the composition of the inhibitor stocks, DMSO might be needed in the control wells to assure consistency across all the experiments.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (232,'Published','negative control',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000230','Used to determine the baseline against which the effect of the test perturbagen is compared. Often the negative control is the solvent (e.g., DMSO) in which the perturbagen was dissolved.',null,null,'Ready',0,{ts '2012-08-25 16:05:26.0'},{ts '2012-08-26 13:53:23.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (233,'Published','positive control',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000231','A chemical compound or reagent used in each plate of an assay to normalize the response of the test perturbagens (by plate). The positive control is known from previous experiments or is a previously established standard. It is usually highly active, resulting in a strong response of the intended effect. In an inhibition assay, the positive control would usually result in the complete inhibition, which measurement is then used for normalization. In an activation assay it would result in high activation, which measurement is then used for normalization. Using controls provides an external reference and reduces the number of false negatives and false positives.',null,null,'Ready',0,{ts '2012-07-02 15:17:53.0'},{ts '2012-08-26 13:53:24.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (234,'Published','ex situ immunoassay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000232','Measures the concentration of a substance in a solution based on the specific binding of an antibody to that substance, which produces a measurable signal. The signal measured depends on the label that is associated with this interaction, such as radioactive (in radioimmunoassays), fluorescent, phosphorescent, and chemiluminescent dyes, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (235,'Published','protein fragment complementation assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000233','Used to study the interaction of two proteins. An enzyme or fluorescent protein is rationally dissected into two fragments and fused to two test proteins, whose interaction is being studied. When the two test proteins bind, the enzyme or fluorescent protein is reconstituted to a functional state, and that functionality can be measured.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (236,'Published','radioligand binding assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000234','Used for analysis of receptor-ligand interactions in screening applications, and measures the level of binding of a radiolabeled ligand to some receptor, which can be on cell membranes or in soluble/purified form.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (237,'Published','allosteric binding',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000235','Used for analysis of the levels at which a small molecule that can bind to sites other than the receptor active site affects the activity of the receptor.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (238,'Published','competitive binding',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000236','Used for analysis of the competition between a labeled and an unlabeled ligand in the reaction with a receptor binding agent (e.g., antibody, receptor, transport protein).',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (239,'Published','irreversible binding',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000237','Used for analysis of the levels of permanent binding of the ligand to a receptor that cannot be dissociated by changing the binding conditions such as buffer, salt concentration, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (240,'Published','non-competitive binding',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000238','Used for analysis of the degree to which non-competitive ligands interact with receptors at sites distinct from the competitive ligand binding pocket, conferring multiple modes of action.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (241,'Published','reversible binding',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000239','Used for analysis of the degree to which the interaction of the ligand with a receptor can be dissociated by changing the binding conditions, e.g., buffer, salt concentration, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (242,'Published','saturation binding',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000240','Used for analysis of specific radioligand binding at equilibrium at various concentrations of the radioligand.',null,null,'Ready',0,{ts '2012-08-26 13:15:51.0'},{ts '2012-08-26 13:53:24.0'},'pclemons',null,'none','no');
