INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (263,'Published','substrate',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000261',null,null,null,'Ready',0,{ts '2012-08-25 16:05:28.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (264,'Published','allosteric modulation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000262','An allosteric effector operates to enhance active site substrate affinity and/or catalysis. An allosteric inhibitor decreases activity by binding to an allosteric site, other than or in addition to the active site on the target. This interaction is characterized by a conformational change in the target enzyme that is required for inhibition.',null,null,'Ready',0,{ts '2012-07-02 15:17:53.0'},{ts '2012-08-26 13:53:25.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (265,'Published','competitive inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000263','Results from a competitive inhibitor binding only to free enzyme. Often this binding event occurs on the active site of the target, precisely where substrate also binds. It raises the apparent KM value for its substrate with no change in the apparent Vmax value. As a result, competitive inhibition can be overcome, observed by an increase in the apparent KI value, at higher concentrations of substrate.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (266,'Published','enzyme activation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000264','The increase in the activity of an enzyme from binding to a perturbagen.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (267,'Published','enzyme inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000265','The decrease in the activity of an enzyme from binding to a perturbagen.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (268,'Published','non-competitive inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000266','Results from a non-competitive inhibitor binding equally well to both free enzyme and the enzyme-substrate complex. These binding events occur exclusively at a site distinct from the precise active site occupied by substrate. It will lower the apparent Vmax value, yet there is no effect on the apparent KM value for its substrate. Essentially, the KI of the inhibitor does not change as a function of the substrate concentration.',null,null,'Ready',0,{ts '2012-07-02 15:17:53.0'},{ts '2012-08-26 13:53:25.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (269,'Published','partial inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000267','Results from the formation of an enzyme-substrate-inhibitor complex that can generate product with less efficiency than the enzyme-substrate complex.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (270,'Published','tight-binding inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000268','Results from the population of free, soluble inhibitor being significantly depleted by the formation of the enzyme-inhibitor or enzyme-substrate-inhibitor complex. While tight-binding inhibitors can bind to the target enzyme in a competitive, non-competitive, or uncompetitive manner with respect to substrate binding, they can display non-competitive phenotypes.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (271,'Published','time-dependent inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000269','Results from time-dependent inhibitors binding slowly to an enzyme on the time scale of enzymatic turnover. This displays a change in initial velocity with time and has the effect of slowing the observed onset of inhibition.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:25.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (272,'Published','uncompetitive inhibition',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000270','Results from an uncompetitive inhibitor binding exclusively to the enzyme-substrate complex, yielding an inactive enzyme-substrate-inhibitor complex. When encountered, the apparent Vmax value and the apparent KM value should both decrease.',null,null,'Ready',0,{ts '2012-07-02 15:17:53.0'},{ts '2012-08-26 13:53:25.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (273,'Published','filter-based method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000271',null,null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (274,'Published','flow cytometry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000272','Uses the principles of light scattering and fluorescence from fluorochrome molecules to generate specific multi-parameter data from particles and cells in the size range of 0.5um to 40um diameter.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (275,'Published','fluorescence intensity',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000273','The measure of fluorescence from a sample.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (276,'Published','fluorescence polarization',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000274','Used to measure binding interactions, fluroescence polarization (FP) measurements are based on the assessment of the rotational motions of species. It is used to measure binding interactions. When linear polarized light is used to excite fluorophores, only those aligned with the plane of polarization will be excited. For fluorophores attached to small, rapidly rotating molecules, the initially photoselected orientational distribution becomes randomized prior to emission, resulting in low fluorescence polarization. But binding of the low molecular weight tracer to a large, slowly rotating molecule results in high fluorescence polarization.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (277,'Published','fluorescence resonance energy transfer',null,'FRET','http://www.bard.nih.gov/ontology/bard#BARD_0000275','Fluorescence resonance energy transfer (FRET) is based on the transfer of energy between two fluorophores, a donor and an acceptor, when in close proximity. The energy transfer is directed from higher-energy donor fluorophore to lower-energy acceptor fluorophore of labeled protein pairs. Target protein pairs are likely to exhibit FRET if they are no more than 10 nm apart.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (278,'Published','monochrometer-based method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000276',null,null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (279,'Published','thermal shift',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000277','Upon heating, a protein unfolds and loses the native conformation. Binding of a small molecule can often stabilize the protein conformation, resulting in a higher unfolding temperature. The temperature shift in unfolding can be detected using a fluorescent dye, which is sensitive to the protein environment.',null,null,'Ready',0,{ts '2012-08-26 13:15:53.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
