INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (284,'Published','immunocytochemistry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000282','Used to detect proteins and peptides in a cell by binding to specific antibodies. Subsequently, a secondary antibody that is conjugated to a fluorophore or an enzyme needed for the detection of a signal is hybridized to the primary antibody. Signal is generally detected by immunofluorescence or less commonly, by a colored reaction. This allows the detection and subcellular localization of the protein of interest by visualization under a microscope.',null,null,'Ready',0,{ts '2012-08-26 13:15:54.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (285,'Published','immunohistochemistry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000283','Used to detect proteins and peptides in a tissue section by binding to specific antibodies. Subsequently, a secondary antibody that is conjugated to a fluorophore or an enzyme needed for the detection of a signal is hybridized to the primary antibody. Signal is generally detected by immunofluorescence or less commonly, by a colored reaction. This allows the detection and subcellular localization of the protein of interest by visualization under a microscope.',null,null,'Ready',0,{ts '2012-08-26 13:15:54.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
