INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (291,'Published','normalized data',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000289','Normalization is the process of reducing unwanted variation either within or between arrays. Data can be normalized by Z and Z'' factors, signal to background, signal to noise, and coefficient of variance. Plate-based normalization is usually based on controls. In the absence of controls, the Z-score can be used to normalize the data by plate.',null,null,'Ready',0,{ts '2012-08-26 13:15:54.0'},{ts '2012-08-26 13:53:26.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (292,'Published','raw data',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000290','Readout obtained from a high-throughput assay that includes measurements from the positive and negative control wells in each plate. This is the data that needs to be processed.',null,null,'Ready',0,{ts '2012-07-02 15:17:54.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (293,'Published','circular dichroism',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000291','Technology for assessing interactions of chiral molecules with circularly polarized electromagnetic rays. Secondary and tertiary structure of proteins will impart a distinct circular dichroism (CD) to that molecule allowing the use of the CD technology to examine the protein folding under different conditions. Information about conformational properties of nucleic acids can be obtained by CD spectroscopy.',null,null,'Ready',0,{ts '2012-07-02 15:17:45.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (294,'Published','electrical sensor',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000292','Used to measure the electrical impedance, or the current-voltage relationships, of ion channels.',null,null,'Ready',0,{ts '2012-08-26 13:15:54.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (295,'Published','isothermal titration calorimetry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000293','Thermodynamic technique that can directly measure the heat released or absorbed during a biomolecular binding event. Isothermal titration calorimetry (ITC) can measure the binding affinity (Ka), reaction stoichiometry (n), enthalpy (_H), and entropy (_S) of the interaction between two or more molecules in solution.',null,null,'Ready',0,{ts '2012-08-26 13:15:54.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (296,'Published','mass spectrometry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000294','Used to detect compounds that are bound to the protein targets. The unbound compounds are separated by affinity based, size exclusion, or ultrafiltration methods. The bound compounds are eluted from the protein and mass spectrometry is used to determine the chemical structure of molecules. Based on the separation method, the throughput varies: between 200-2700 compounds can be loaded in each run for separation. The samples are vaporized, followed by ionization and then the mass to charge ratio of the particles is analyzed.',null,null,'Ready',0,{ts '2012-07-02 15:17:46.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (297,'Published','nuclear magnetic resonance spectroscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000295','Used to analyze protein-small molecule interactions. This binding interaction is commonly monitored by the chemical shift of the compound. With nuclear magnetic resonance (NMR), both the binding interaction and bound compounds can be detected, which allows pools of 5-100 compounds to be tested for binding.',null,null,'Ready',0,{ts '2012-07-02 15:17:46.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (298,'Published','optical-based detection',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000296','Uses evanescent waves (surface plasmon resonance, resonant waveguide grating) or interference of light waves to characterize the cellular processes that are taking place at or near the sensor surface: e.g., to study the affinity of a sample to the biological receptors immobilized on the sensor surface.',null,null,'Ready',0,{ts '2012-07-02 15:17:46.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (299,'Published','quartz crystal microbalance',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000297','Technology based on measuring the resonant frequency of piezoelectric quartz crystals. It allows measurement of important cellular parameters such as adhesion, proliferation, and cytotoxicity. Quartz crystal microbalance (QCM) is also used for the identification of protein ligands by immobilized receptors.',null,null,'Ready',0,{ts '2012-08-26 13:15:54.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (300,'Published','X-ray crystallography',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000298','Used to analyze protein-small molecule interactions. This binding interaction is monitored by measuring the difference of diffraction between protein-compound binding complex and protein alone. With X-ray crystallography, both the binding interaction and bound compounds can be detected, which allows pools of 5-100 compounds to be tested for binding.',null,null,'Ready',0,{ts '2012-07-02 15:17:46.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (301,'Published','colorimetric labeling method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000299',null,null,null,'Ready',0,{ts '2012-08-26 13:15:55.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (302,'Published','fluorescent labeling method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000300',null,null,null,'Ready',0,{ts '2012-08-26 13:15:55.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (303,'Published','immunolabeling method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000301','A means of localizing particular antigens within tissue. Immunolabeling is a methodological process where: antibodies are used to identify antigens within an organism and a tag (e.g., through fluorescence, gold beads, epitope tag, etc.) is added to a secondary antibody which binds to the primary antibody.',null,null,'Ready',0,{ts '2012-08-26 13:15:55.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (304,'Published','isotope labeling method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000302',null,null,null,'Ready',0,{ts '2012-08-26 13:15:55.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (305,'Published','photoaffinity labeling method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000303','Technology that attaches a label to the active site of a large molecule, especially a protein. Uses a molecule that binds loosely and reversibly to the large molecule''s active site and has an inactive part that can be converted by photolysis to a highly reactive form. This causes the complex of the large substrate molecule and the loosely attached label to bind more permanently.',null,null,'Ready',0,{ts '2012-08-26 13:15:55.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (306,'Published','vital dye staining method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000304','Employs a stain that is capable of entering and staining a living cell without causing an injury.',null,null,'Ready',0,{ts '2012-07-02 15:17:46.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (307,'Published','functional activation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000305','Increase of a predefined stimulus. Unit of measure is always % when normalized to the dynamic range of the assay.',null,null,'Ready',0,{ts '2012-07-02 15:17:46.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
