INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (309,'Published','functional stimulation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000307','Increase of a predefined stimulus. Unit of measure is always % when normalized to the dynamic range of the assay.',null,null,'Ready',0,{ts '2012-08-26 13:15:55.0'},{ts '2012-08-26 13:53:27.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (310,'Published','AlphaScreen',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000308','Technology that measures the interaction of two molecules bioconjugated to donor and acceptor beads. Laser excitation leads to light emission which is directly proportional to the amount of binding, provided molecules are in proximity to cause a chemical reaction (interact). Users have modified this and coupled it to chemiluminescence emission. This technology has been adapted to study protein-protein, protein-DNA and receptor-ligand, immunoassay, phosphorylation, and protease reactions.',null,null,'Ready',0,{ts '2012-07-02 15:17:56.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (311,'Published','bioluminescence',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000309','Refers to the production and emission of light by a living organism. Bioluminescence is a naturally occurring form of chemiluminescence whereby energy is released by a chemical reaction in the form of light emission. The chemical reaction can occur either inside or outside the cell, and can be detected using a plate reader or a charge-coupled device (CCD) camera.',null,null,'Ready',0,{ts '2012-07-02 15:17:58.0'},{ts '2012-08-26 13:53:27.0'},'schatwin',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (312,'Published','chemiluminescence',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000310','The generation of light as a result of a chemical reaction using synthetic compounds and usually involving a highly oxidized species such as peroxide.',null,null,'Ready',0,{ts '2012-07-02 15:17:57.0'},{ts '2012-08-26 13:53:28.0'},'schatwin',null,'element','RDM request');
