INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (335,'Published','polymerase chain reaction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000333','Technique to amplify a single or few copies of a piece of DNA across several orders of magnitude, generating thousands to millions of copies of a particular DNA sequence. The polymerase chain reaction (PCR) method relies on thermal cycling, consisting of cycles of repeated heating and cooling of the reaction for DNA melting and enzymatic replication of the DNA. Primers (short DNA fragments) containing sequences complementary to the target region along with a DNA polymerase (after which the method is named) are key components to enable selective and repeated amplification. As PCR progresses, the DNA generated is itself used as a template for replication, setting in motion a chain reaction in which the DNA template is exponentially amplified.',null,null,'Ready',0,{ts '2012-08-26 13:15:56.0'},{ts '2012-08-26 13:53:29.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (336,'Published','RNA-seq method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000334','An approach for transcriptome profiling that uses deep-sequencing technologies. RNA-Seq, also called Whole Transcriptome Shotgun Sequencing (WTSS), refers to the use of high-throughput sequencing technologies to sequence cDNA in order to get information about a sample''s RNA content. Thanks to the deep coverage and base level resolution provided by next-generation sequencing instruments, RNA-Seq provides researchers with efficient ways to measure transcriptome data experimentally, allowing them to get information such as how different alleles of a gene are expressed, detect post-transcriptional mutations, or identifying gene fusions.',null,null,'Ready',0,{ts '2012-08-26 13:15:56.0'},{ts '2012-08-26 13:53:29.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (337,'Published','autoradiography',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000335',null,null,null,'Ready',0,{ts '2012-08-26 13:15:56.0'},{ts '2012-08-26 13:53:29.0'},'pclemons',null,'none','no');
