INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (339,'Published','scintillation counting',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000337','Technology that incorporates radiolabeled precursors into uniform distribution with a liquid medium capable of converting the kinetic energy of nuclear emissions into light energy. A scintillation counter is used to measure ionizing radiation, and consists of a sensor, called a scintillator, made of transparent crystal or an organic liquid that fluoresces when struck by ionizing radiation. A photomultiplier is then used to measure the light emitted by the sensor and is attached to an electronic apparatus that amplifies and quantifies the radiation signal.',null,null,'Ready',0,{ts '2012-08-26 13:15:57.0'},{ts '2012-08-26 13:53:29.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (340,'Published','assay medium',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000338','The cell culture broth used while performing an assay on cells, which is optimized for each assay type. Some interfering additives such as serum, growth factors, buffers, amino acids, antibiotics, etc., might be eliminated in this medium.',null,null,'Ready',0,{ts '2012-08-26 13:15:57.0'},{ts '2012-08-26 13:53:29.0'},'pclemons',null,'none','no');
