INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (353,'Published','beta-galactosidase induction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000351','Technique in which the beta galactosidase gene is attached to the regulatory sequence of a gene of interest. The effect of a perturbagen on the expression of the gene of interest can be monitored by the detection of the product of beta galactosidase enzyme.',null,null,'Ready',0,{ts '2012-08-26 13:15:57.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
