INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (355,'Published','chloramphenicol acetyltransferase induction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000353','Technique in which the chloramphenicol acetyltransferase (CAT) gene is attached to the regulatory sequence of a gene of interest. When induced to express, CAT breaks down the antibiotic chloramphenicol, resulting in a resistance against that antibiotic. The effect of a perturbagen on the expression of the gene of interest can be monitored by the gain of antibiotic resistance in the cells.',null,null,'Ready',0,{ts '2012-08-26 13:15:57.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (356,'Published','fluorescent protein induction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000354','Technique in which fluorescent proteins are used as reporter genes to study the effect of perturbagens on gene expression. Examples include green fluorescent protein (GFP) from the jellyfish Aequorea victoria and the various modifications of it created by amino acid substitutions to either optimize the codon usage in mammalian cells or to change the spectral properties of the protein.',null,null,'Ready',0,{ts '2012-08-26 13:15:57.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (357,'Published','luciferase induction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000355','Technique in which the luciferase gene is attached to the regulatory sequence of a gene of interest. The effect of a perturbagen on the expression of the gene of interest can be measured by the detection of light emitted as a product the luciferase reaction.',null,null,'Ready',0,{ts '2012-07-02 15:17:56.0'},{ts '2012-08-26 13:53:30.0'},'schatwin',null,'none','no');
