INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (360,'Published','cyclic-GMP redistribution',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000358','Cyclic GMP (cGMP) functions as second messenger in cell signaling.',null,null,'Ready',0,{ts '2012-08-26 13:15:58.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (361,'Published','absorbance',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000359','The absorbance of a beam of collimated monochromatic radiation in a homogeneous isotropic medium is proportional to the absorption path length and to the concentration of the absorbing species. Absorbance is a logarithmic measure of the amount of light (at a specific wavelength) that is absorbed when passing through a sample. A= -log10(I/I0), where A is absorbance, I is the intensity of incident light, and I0 is the intensity of light transmitted after passing through the sample.',null,null,'Ready',0,{ts '2012-08-26 13:15:58.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (362,'Published','atomic absorption spectrophotometry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000360',null,null,null,'Ready',0,{ts '2012-08-26 13:15:58.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (363,'Published','transmittance',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000361','The transmittance of a sample is the ratio of the intensity of the light that has passed through the sample to the intensity of the light when it entered the sample (T = Iout / Iin ). To convert between the absorbance and transmittance scales, the following equation is used: A = -log T = - log (I / Io).',null,null,'Ready',0,{ts '2012-08-26 13:15:58.0'},{ts '2012-08-26 13:53:30.0'},'pclemons',null,'none','no');
