INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (370,'Published','bioluminescence resonance energy transfer',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000368','Bioluminescence resonance energy transfer (BRET) is similar to fluorescence resonance energy transfer (FRET), but uses a bioluminescent protein such as aequorin as the donor and a fluorescent acceptor such as GFP. The donor emits blue light in the absence of GFP, but when GFP and aequorin are associated, GFP accepts the energy from aequorin and emits green light. Hence BRET eliminates the disadvantages associated with donor fluorophore activation.',null,null,'Ready',0,{ts '2012-08-26 13:15:58.0'},{ts '2012-08-26 13:53:31.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (371,'Published','chemiluminescence resonance energy transfer',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000369','Chemiluminescence resonance energy transfer (CRET) is a resonance energy transfer between chemiluminescent donors and fluorescent acceptors. In this technique, a luminescent substrate, such as luminol, is oxdized; an example of this is the luminol/hydrogen peroxide reaction catalyzed by horseradish peroxidase. CRET eliminates the disadvantages associated with donor fluorophore activation.',null,null,'Ready',0,{ts '2012-08-26 13:15:58.0'},{ts '2012-08-26 13:53:31.0'},'pclemons',null,'none','no');
