INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (387,'Published','carbon nanotube-based sensor',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000385','Carbon nanotubes (CNT) are rolled up seamless cylinders of graphene sheets, exhibiting many unique physical, mechanical, and chemical properties. CNT-based biosensors are used to detect protein interactions, e.g., protein-DNA, antibody-aptamer interaction, etc.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:31.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (388,'Published','impedance-based sensor',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000386','Measures the electrical opposition of an interface in AC steady state with constant DC bias conditions. This is accomplished by imposing a small sinusoidal voltage at a particular frequency and measuring the resulting current; the process can be repeated at different frequencies. The current-voltage ratio gives the impedance.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (389,'Published','microelectrode measurement',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000387','Electrical recordings of membrane potential from electrically active cells, such as neurons and muscle and endocrine cells, can be obtained by the insertion or attaching microelectrodes to these cells. Patch clamp, voltage clamp, and current clamp are three ways of studying the current-voltage relationships of these ion channels.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (390,'Published','dot immunobinding assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000388','In the dot immunobinding assay (Dot Iba) immunodiagnostic method, antibody or antigen is dotted directly onto nitrocellulose membrane (NCM) discs. The diagnostic material to be checked can be incubated on this disc. Presence of antigen antibody complex in NCM discs is directly demonstrated with enzyme-conjugated antiglobulins and substrate. Development of a purple-pink insoluble substrate product in the NCM is a positive result in the assay. This assay allows the processing of multiple specimens at a time.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (391,'Published','enzyme-linked immunosorbent assay',null,'enzyme-linked immunosorbent','http://www.bard.nih.gov/ontology/bard#BARD_0000389','Enzyme-linked immunosorbent assay (ELISA) is used to detect the presence of a particular protein, either an antigen or an antibody, in a sample, such as a body fluid.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (392,'Published','enzyme-multiplied immunoassay technique',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000390','Enzyme multiplied immunoassay technique (EMIT) is a common method for screening urine and blood for drugs. A mix and read protocol has been developed that is simple and rapid. The most widely used applications for EMIT are for therapeutic drug monitoring (serum) and as a primary screen for abused drugs and their metabolites (urine).',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (393,'Published','immunoblot',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000391',null,null,null,'Ready',0,{ts '2012-07-02 15:17:58.0'},{ts '2012-08-26 13:53:32.0'},'schatwin',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (394,'Published','radioimmunoassay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000392',null,null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (395,'Published','two-site enzyme immunoassay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000393','Measures the amount of antigen in a sample. The antigen under assay which must have two or more epitopes. It is insolubilized by reaction with an unlabelled antibody conjugated to a solid phase, then reacted with an enzyme-labelled antibody directed to a different epitope of the analyte. The quantity of labelled antibody which becomes immobilized due to the complexing reaction is directly proportional to the amount of analyte present in the sample.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (396,'Published','homogeneous time-resolved fluorescence',null,'homogeneous time-res. fluor.','http://www.bard.nih.gov/ontology/bard#BARD_0000394','Homogenous time resolved fluorescence (HTRF) is a technology which combines standard fluorescence resonance energy transfer (FRET) technology with time-resolved measurement of fluorescence, by which means HTRF eliminates short-lived background fluorescence. Introducing a time delay (50-150 microseconds) between the system excitation and fluorescence measurement allows the signal to be cleared of all non-specific short-lived emissions.',null,null,'Ready',0,{ts '2012-08-26 13:15:59.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (397,'Published','time-resolved fluorescence resonance energy transfer',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000395','Time resolved-fluorescence resonance energy transfer (TR-FRET) unites time-resolved fluorescence (TRF) and fluorescence resonance energy transfer (FRET) principles, bringing together the low background benefits of TRF with the homogeneous assay format of FRET. Introducing a time delay (50-150 micro seconds) between the system excitation and fluorescence measurement allows the signal to be cleared of all non-specific short lived emissions. TR-FRET uses lanthanide donors, which are fluorophores with long emission half-lives.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (398,'Published','fluorescent DNA hybridization probe method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000396',null,null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
