INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (404,'Published','immunogold labeling method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000402','The identification of an antigen by conjugating gold particles to a primary or secondary antibody.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (405,'Published','electron microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000403','Uses the diffraction, reflection, or refraction of electron beams interacting with the subject of study and the subsequent collection of this scattered radiation to build an image of the subject.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (406,'Published','optical microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000404','Uses visible light transmitted through or reflected from a sample through a single or multiple lenses to magnify the view of the sample.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (407,'Published','scanning probe microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000405','Forms images of surfaces using a physical probe that scans the specimen and measures on a fine scale, down to the level of molecules and groups of atoms. The resolution is not limited by the diffraction, but by the size of probe-sample interaction volume. Atomic force microscopy (AFM), scanning tunneling microscopy (STM), and near-field scanning optical microscopy (NSOM) are the three common scanning probe techniques.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:32.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (408,'Published','gene array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000406','Provides a collection of gene-specific nucleic acids that have been placed at defined locations on a solid support either by spotting or direct synthesis. Labeled nucleic acids from a sample are hybridized with target genes on the array and the signals measured, which reflects the composition of the sample nucleic acids.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (409,'Published','oligonucleotide array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000407','Provides a collection of oligonucleotides that are immobilized by spotting on a solid support, such as a glass slide. They are hybridized with labeled nucleic acids from a sample and the signals measured, which reflects the composition of the sample nucleic acids. This is performed to either quantify gene expression or genomic profiling to understand genetic variation in humans.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (410,'Published','bio-layer interferometry',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000408','Measures biomolecular interactions by analyzing the interference pattern of white light reflected from two surfaces: a layer of immobilized protein on the biosensor tip and an internal reference layer. Changes in the number of molecules bound to the biosensor tip cause a shift in the interference pattern, which can be measured in real time.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (411,'Published','fiber optic waveguide',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000409','Based on the ability of a transparent substance, such as glass, to conduct some of the visible or near-visible light to its interior by means of internal reflection.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (412,'Published','optical waveguide grating',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000410','The optical grating coupler sensor responds to the change of optical refractive index of the liquid or gas cover medium and to the adsorption or binding of molecules on the surface. The optical grating coupler sensor chip is based on a fine optical grating prepared on a thin waveguide layer carried by a glass substrate. The optical grating couples the light of a He-Ne laser at a given resonance angle into the waveguide layer. This incoupling angle is very sensitive to the presence of adsorbed molecules and to any change of refractive index of the medium covering the surface of the chip. By precise measurement of the incoupling angle, the amount of the adsorbed material can be determined with ultra high sensitivity.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (413,'Published','resonant waveguide grating',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000411','Cells are directly cultured onto the surface of a resonant waveguide grating (RWG) biosensor. The mass redistribution within the bottom portion of cells, mediated by stimulus, is directly measured with the biosensor. RWG biosensor uses an optical beam with an appropriate angular content to illuminate a waveguide film in which a grating structure is embedded. When this beam is reflected by the sensor surface, the resonant angle dominates in the output beam. The mass redistribution within the sensing volume alters the incident angle. Because of its ability for multiparameter measurements, the biosensor has potential to provide high information content for cell sensing. These parameters include the angular shift (one of the most common outputs), the intensity, the peak width at half-maximum (PWHM), and area of the resonant peaks.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (414,'Published','surface plasmon resonance',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000412','The target protein is immobilized onto a solid surface via covalent or noncovalent interaction. Binding of small molecule compounds changes the refractive index of the immobilized target, which can be detected by optical sensing. Shift in wavelength of light is proportional to mass changes near the sensor surface, with sensitivity to detect mass change being ~300 Da.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (415,'Published','real-time polymerase chain reaction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000413','Technique based on the polymerase chain reaction (PCR), and also called quantitative real time polymerase chain reaction (Q-PCR/qPCR) or kinetic polymerase chain reaction. It enables both detection and quantification (as absolute number of copies or relative amount when normalized to DNA input or additional normalizing genes) of one or more specific sequences in a DNA sample.',null,null,'Ready',0,{ts '2012-08-26 13:16:00.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (416,'Published','reverse transcription polymerase chain reaction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000414','Reverse transcription polymerase chain reaction (RT-PCR) is a variant of the polymerase chain reaction (PCR) in which the RNA strand is first reverse-transcribed into its DNA complement (complementary DNA, or cDNA) using the enzyme reverse transcriptase, and the resulting cDNA is amplified using traditional or real-time PCR.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (417,'Published','analytical array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000415','Method in which antibodies or peptides are spotted on a support and hybridized to analytes in complex mixtures of proteins.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (418,'Published','lysate array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000416','Contains complex samples, such as cell or tissue lysates, spotted on an array surface and interrogated with antibodies.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (419,'Published','purified protein array',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000417','Method in which many different purified proteins are spotted on a support, and used to assay biochemical functions such as protein-protein, protein-DNA, protein-small molecule interactions, and enzyme activity.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (420,'Published','protein form',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000419','Describes whether changes were introduced into a protein sequence and the type of changes, e.g., fusion, mutation, deletion, post-translational modifications.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (421,'Published','protein preparation method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000420','Method by which a protein is purified from its source.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (422,'Published','protein purity',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000421','The steps to isolate a protein from either its natural or recombinantly-expressed sources. It involves lysis by either mechanical or chemical means, followed by a series of centrifugation and/or chromatography and electrophoresis methods.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (423,'Published','protein sequence',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000422',null,null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (424,'Published','filter-based scintillation method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000423','Method for examining the interaction between a radio-labeled ligand and the receptor. The reaction mixture containing the receptor and radioligand is transferred to a filter plate and washed to remove the unbound radioligand. The bound complex remains on the filter, which can be eluted into the scintillation fluid and the radioactivity measured. Filter assays differ from scintillation proximity assays (SPA) because a separation of free radioligand and radioligand bound to the receptor is required for measurement.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (425,'Published','lysate-based scintillation method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000424','Method for examining the interaction between a radio-labeled ligand and the receptor in presence of cold ligand. The cells exposed to the radioligand and cold ligand are washed to remove the unbound ligands. They are then lysed and the bound radioactivity is counted in a liquid scintillation counter.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (426,'Published','scintillation proximity assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000425','Scintillation proximity assay (SPA) eliminates the separation step of unbound radioisotopes and is performed using low energy radioisotopes (3H and 125I) as labels, which have short range electron emission. SPA involves the use of microscopic beads which are first coated with a receptor protein of interest and contain a scintillant. When stimulated by the binding of radiolabeled ligand molecules, they emit light, which is detected by the photomultiplier tube. SPA is suitable for high throughput since the protocol has no wash or separation steps.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (427,'Published','dye exclusion method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000426','Method in which the dye is excluded from particular cells, usually due to the presence of an intact plasma membrane.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (428,'Published','vital staining of cells',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000427',null,null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:33.0'},'pclemons',null,'none','no');
