INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (430,'Published','cell-culture component',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000429','Components of a specific medium in which a cell culture is prepared, which is optimized for its growth; includes medium additives such as serum, growth factors, buffers, amino acids, and antibiotics (this information may be obtained from ATCC or found in relevant publications).',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (431,'Published','cell-growth mode',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000430',null,null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'element','RDM request');
