INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (434,'Published','bacterial infection method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000433','Live cell assay in which eukaryotic cells are infected with bacteria.',null,null,'Ready',0,{ts '2012-08-26 13:16:01.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (435,'Published','cell-fusion method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000434','Method by which a hybrid cell is formed from two different cells of same or different species. After such fusion, one of the parental cells has a dominant phenotype over the other, and the resulting hybrids will have the features of only one of the parental cells. Fusion is performed to understand the dominance of genetic material, DNA recombination events, etc.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'element','direct');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (436,'Published','genetic modification method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000435','Cloned genes are introduced into cells by various methods, including transfection, transduction, electroporation, nucleofection, etc. It is generally performed to express the exogenously introduced gene and study its effect on the cell. In addition, DNA encoding regulatory moieties, such as siRNA, is similarly introduced to inhibit the expression of a specific gene(s).',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (437,'Published','cellular organism',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000436','Includes all organisms which are made up of cells, e.g., bacteria, fungi, plants, and animals.',null,null,'Ready',0,{ts '2012-07-02 15:17:42.0'},{ts '2012-08-26 13:53:34.0'},'schatwin',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (438,'Published','virus',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000437','Small infectious agents that depend on the host cells to reproduce. Outside the host, they contain a protein coat called capsid that encloses their genetic material (either DNA or RNA). Viruses can infect bacteria, plants and animals and cause a number of diseases, e.g., smallpox, chickenpox, influenza, polio, rabies, etc.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (439,'Published','scanning electron microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000438','Scanning electron microscopy (SEM) visualizes details on the surfaces of cells and particles and provides a 3D view. It gives results much like those of the stereo light microscope. The most useful magnification of SEM is in a lower range than that of the transmission electron microscope.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (440,'Published','transmission electron microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000439','Transmission electron microscopy (TEM) sends an electron beam through a very thin slice of the specimen. The resolution limit in 2005 was approximately 0.05 nanometer and has not increased appreciably since that time.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (441,'Published','antigen down assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000440','Technology that binds an antigen to a solid surface instead of to an antibody. Also called an immunometric assay, this assay is used to bind antibodies found in a sample. When a sample (such as human serum) is added, the antibodies (IgE for example) from the sample bind to the antigen coated on the plate.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (442,'Published','chemiluminescence-linked immunosorbent assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000441',null,null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (443,'Published','competitive immunoassay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000442','Technology based on the competition of labeled and unlabeled ligand for a limited number of antibody binding sites. The free antigen and antibody are incubated to form antigen-antibody complex and then the complex is bound to the antigen-coated surface of the assay plate. The unbound antibody-antigen complex is washed off before adding an enzyme-linked secondary antibody against the primary antibody. The substrate is then added and the antigen concentration can be determined by the signal strength elicited by the enzyme-substrate reaction. In this assay, the enzyme-linked secondary antibody competes with the sample antigen that is associated with the primary antibody.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (444,'Published','enzyme-linked immunosorbent spot assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000443','Technology based on the enzyme-linked immunosorbent assay (ELISA) immunosassay. Enzyme-linked immunosorbent spot (ELISPOT) assays were originally developed to enumerate B cells secreting antigen-specific antibodies, and have subsequently been adapted for other purposes, especially the identification and enumeration of cytokine-producing cells at the single cell level. Under appropriate conditions, the ELISPOT assay allows visualization of the secretory product of individual activated or responding cells. Each spot that develops in the assay represents a single reactive cell. Thus, the ELISPOT assay provides both qualitative (type of immune protein) and quantitative (number of responding cells) information.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (445,'Published','fluorescence-linked immunosorbent assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000444','Technology using a fluorescent probe on an antibody of interest, resulting in direct detection of fluorescence intensity. Compared with the sandwich enzyme-linked immunosorbent assay (ELISA), the fluorescence-linked immunosorbent assay (FLISA) has similar sensitivity and specificity, but it is much more rapid, economic, and convenient.',null,null,'Ready',0,{ts '2012-07-02 15:17:42.0'},{ts '2012-08-26 13:53:34.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (446,'Published','sandwich enzyme-linked immunosorbent assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000445','Technology that measures the amount of antigen between two layers of antibodies. The antigens to be measured must contain at least two antigenic sites capable of binding to antibodies, since at least two antibodies act in the sandwich, so sandwich assays are restricted to the quantitation of multivalent antigens such as proteins or polysaccharides. Sandwich enzyme-linked immunosorbent assays (sandwich ELISAs) for quantitation of antigens are especially valuable when the concentration of antigens is low and/or the antigens are contained in high concentrations of contaminating protein.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (447,'Published','expressed protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000446',null,null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (448,'Published','expressed RNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000447',null,null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:34.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (449,'Published','mutated gene',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000448','A gene containing a mutation, defined as any alteration in a gene, and a mutation may be disease-causing or a normal variant. Mutations are introduced into cDNA that encode proteins of interest. Different types of mutations include missense, nonsense, deletions, and insertions.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (450,'Published','wild-type gene',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000449',null,null,null,'Ready',0,{ts '2012-07-02 15:17:42.0'},{ts '2012-08-26 13:53:35.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (451,'Published','in-cell Western assay',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000450','An immunocytochemical assay that uses NIR fluorescence to detect and quantify proteins in fixed cells. Detecting proteins in their cellular context increases quantification precision. Proteins in fixed, cultured cells are detected directly in microplates, which yields higher throughput compared to Western blotting and eliminates typical Western blotting steps such as cell lysate preparation, electrophoresis, and membrane transfer.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (452,'Published','Western blot',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000451','An analytical technique used to detect specific proteins in a given sample of tissue homogenate or extract. Also known as protein immunoblot, it uses gel electrophoresis to separate native or denatured proteins by the length of the polypeptide (denaturing conditions) or by the 3-D structure of the protein (native/ non-denaturing conditions). The proteins are then transferred to a membrane (typically nitrocellulose or PVDF), where they are probed (detected) using antibodies specific to the target protein.',null,null,'Ready',0,{ts '2012-08-26 13:16:02.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (453,'Published','current clamp',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000452','Technique used to measure biological voltages, such as the action potential of an excitable cell, with a microelectrode while keeping electrical current through the recording electrode constant. It can be used for both extracellular and intracellular recordings.',null,null,'Ready',0,{ts '2012-07-02 15:17:42.0'},{ts '2012-08-26 13:53:35.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (454,'Published','patch clamp',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000453','Technique used to measure current passing through individual ion channels in cells or through whole cells by a blunt electrode placed on the surface of the cell membrane. Suction is applied via the blunt electrode (glass pipette in classical patch clamp technique) to create a high resistance (gigaohm) between the electrode and cell surface. This seal isolates the ion channels within the patch from the rest of the membrane and allows the neurophysiologist to record only from these ion channels.',null,null,'Ready',0,{ts '2012-07-02 15:17:42.0'},{ts '2012-08-26 13:53:35.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (455,'Published','voltage clamp',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000454','Technique used to measure the ion currents across an excitable cell membrane, such as neuronal membrane, while holding the membrane voltage at a constant level. The neuronal membrane contains different kinds of ion channels including voltage gated ion channels. Manipulation of the membrane voltage using voltage clamping allows the current-voltage relationships of these ion channels to be studied.',null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (456,'Published','brightfield microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000455','Brightfield microscopy illuminates a sample with transmitted white light from below for observation from above.',null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (457,'Published','darkfield microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000456',null,null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (458,'Published','differential interference contrast microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000457',null,null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (459,'Published','fluorescence microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000458','Fluorescence microscopy images the distribution of molecules based on the properties of fluorescence emission. Excitation of fluorescent molecules with a specific wavelength results in the production of an image by the secondary fluorescence emission at longer wavelengths.',null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (460,'Published','phase-contrast microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000459','Phase contrast microscopy shows differences in refractive index as difference in contrast. Regions with higher contrast, such as nuclei, appear darker than the surrounding cytoplasm.',null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (461,'Published','scanning near-field optical microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000460',null,null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
