INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (463,'Published','engineered genotype',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000462',null,null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (464,'Published','modified protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000464','Describes the type of changes that were introduced into a protein coding sequence prior to being used in the bioassay, e.g., introducing mutations, deletions, or fusion to another protein coding sequence, etc.',null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'element','RDM request');
