INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (466,'Published','extraction from natural source',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000466',null,null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (467,'Published','recombinant expression',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000467','The cDNA of the gene of interest is cloned in a plasmid or viral vector and introduced it into a bacterial, insect, or mammalian cell for expression. The cells are lysed, and the expressed protein is purified, followed by a series of centrifugation and/or chromatography and electrophoresis methods.',null,null,'Ready',0,{ts '2012-08-26 13:16:03.0'},{ts '2012-08-26 13:53:35.0'},'pclemons',null,'none','no');
