INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (481,'Published','culture serum',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000481','Serum containing growth factors required for cultured cells division, optimized for each cell culture; typically, fetal bovine serum is used, but other sera such horse serum are used (specialized assay sera, such as dextran charcoal-treated or dialyzed sera, used at the assay stage to avoid interference from normal serum components, should be specified as ''assay reagent'').',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:36.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (482,'Published','cybrid cell creation method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000482','Technique that creates a cybrid cell by fusing a nucleated and an enucleated (nucleus removed) cell. The resulting cybrids have one nucleus, but they contain the mitochondria from both the parental cells. This allows one to study the mitochondrial inheritance and to ascertain the role of mitochondrial DNA mutations in diseases.',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:36.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (483,'Published','hybrid cell creation method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000483','Cell fusion is the formation of a hybrid cell from two different cells of same or different species. Fusion hybrids are created by fusing two nucleated cells obtained from same or different species.',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:36.0'},'pclemons',null,'none','no');
