INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (487,'Published','bacterium',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000487','Prokaryotic cell; bacteria lack membrane-bound organelles and are surrounded by a rigid cell wall. Though they are unicellular, they function by aggregating into multicellular colonies.',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:36.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (488,'Published','eukaryote',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000488','Includes fungi, vertebrates, and invertebrates. Eukaryotic cells have a well-defined nucleus and membrane-enveloped organelles such as mitochondria, endoplasmic reticulum, Golgi apparatus, and lysosomes.',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (489,'Published','gene knockdown',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000489','Technique by which the expression of one or more of an organism''s genes is reduced, either through genetic modification (a change in the DNA of one of the organism''s chromosomes) or by treatment with a reagent such as a short DNA or RNA oligonucleotide with a sequence complementary to either an mRNA transcript or a gene.',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (490,'Published','gene knockin',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000490','Technique by which a protein-coding cDNA sequence is inserted at a particular locus in an organism''s chromosome. The difference between knock-in technology and transgenic technology is that a knock-in involves a gene inserted into a specific locus, and is a targeted insertion.',null,null,'Ready',0,{ts '2012-08-26 13:16:04.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (491,'Published','gene knockout',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000491','Technique by which an organism is engineered to carry genes that have been made inoperative (have been knocked out of the organism).',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (492,'Published','gene overexpression',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000492','Technique by which an organism or cell line is engineered to express increased levels of a gene.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (493,'Published','exogenous protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000493',null,null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (494,'Published','overexpressed protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000494',null,null,null,'Ready',0,{ts '2012-08-25 16:06:46.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (495,'Published','reporter gene',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000495','A gene that is attached to a regulatory sequence of another gene of interest and introduced into cultured cells, animals, or plants. Certain genes function as reporters because they are easily identified and measured, or because they are selectable markers. Common reporter genes are luciferase, green fluorescent protein (GFP), beta-galactosidase, and chloramphenicol acetyltransferase (CAT).',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (496,'Published','esiRNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000496','Endoribonuclease-prepared small interfering RNA (siRNA) pools comprised of a heterogeneous mixture of siRNAs that all target the same messenger RNA (mRNA) sequence.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (497,'Published','miRNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000497','Short RNAs (~22 nucleotides long) known as microRNAs (miRNAs) that bind to complementary sequences in the three prime untranslated regions (3'' UTRs) of target messenger RNA transcripts (mRNAs), usually resulting in gene silencing.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (498,'Published','mRNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000498','messenger RNA (mRNA) is a genetic intermediate between DNA and protein that is transcribed from DNA by RNA polymerases and further processed by other enzymes. mRNA serves as the template to synthesize proteins on the ribosomes.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (499,'Published','RNA aptamer',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000499','Aptamers are synthetic affinity probes. RNA aptamers are oligonucleotides that bind to a specific target molecule such as small molecules, proteins, nucleic acids, or cells. They are created by selecting them from a large random sequence pool, but natural aptamers also exist in riboswitches.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (500,'Published','shRNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000500','Short hairpin RNA (shRNA) can be used to achieve stable knockdown of gene expression. shRNA molecules are cloned into lentiviral or other vectors and expressed by a pol III type promoter.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (501,'Published','siRNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000501','In the RNAi pathway, the double stranded RNAs first get processed into 20-25 nucleotide small interfering RNAs (siRNAs) by an RNase-III-like enzyme called Dicer. The siRNAs enter into endoribonuclease-containing complexes known as RNA-induced silencing complexes (RISCs), and bring about the cleavage of the target mRNAs to achieve gene silencing.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (502,'Published','confocal microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000502','Confocal microscopy has advantages over widefield optical microscopy, including the ability to eliminate or reduce background information away from the focal plane and collect serial optical sections from thick specimens. It uses point illumination and a spatial pinhole to eliminate out-of-focus light in specimens that are thicker than the focal plane.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (503,'Published','total internal reflection fluorescence microscopy',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000503','Total internal reflection fluorescence microscopy probes the surface of fluorescently-labeled living cells with an evanescent wave generated by a light beam traveling between two media of differing refractive indices. An incident laser beam is reflected at a critical angle (total internal reflection) when it encounters the interface between a microscope glass slide and the aqueous medium containing the cells. Only fluorophores which are within a few nanometers of the surface are excited, while those farther away are not, making possible the study the interactions at the cell surface.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:37.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (504,'Published','transfection method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000504','Technology that introduces nucleic acids into cells using a construct. Plasmids constructs are created by the insertion of a gene or siRNA-encoding DNA of interest into a plasmid. The engineered plasmids are introduced into cells by various means, including transfection, electroporation, and nucleofection, that regulate the efficiency and location of gene transfer.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (505,'Published','viral transduction method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000505','Technology in which cells are infected by a pathogenic or a modified virus, which introduces viral genetic material into the cells. Pathogenic viruses used include the influenza virus, measles virus, and Japanese encephalitis virus. For recombinant expression of proteins in cells or tissues, several types of virus are utilized, including lentivirus, retrovirus, and adenovirus, with each having their own advantages and disadvantages.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (506,'Published','fused protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000506','Fusion proteins or chimeric proteins are created through the joining of two or more cDNAs which encode different proteins. Upon expression, a single polypeptide containing each of the proteins results. Generally, the protein of interest is tagged with a reporter protein, such as luciferase or GFP, whose expression can be monitored.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (507,'Published','mutated protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000507','Mutated proteins are created by introducing mutations into the cDNAs that encode the proteins of interest and introducing those cDNA constructs into cells for expression. Different types of mutations include missense, nonsense, deletions, and insertions.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (508,'Published','phosphorylated protein',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000508',null,null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (509,'Published','deleted gene',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000509','The loss of one or more nucleotides in the genetic material (DNA or RNA), either due to a mutation or by genetic engineering. Deletion of genetic material can cause serious genetic diseases.',null,null,'Ready',0,{ts '2012-08-26 13:16:05.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (510,'Published','inserted gene',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000510','The addition of one or more nucleotides into the genetic material (DNA or RNA), which can lead to a frameshift during translation. This generates a missense or nonsense mutation, and such a protein is often non-functional.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (511,'Published','point-mutated gene',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000511','The replacement of a single nucleotide with a different nucleotide in the genetic material (DNA or RNA). It results in missense, nonsense, or silent mutations.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (512,'Published','infrared imaging',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000512',null,null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (513,'Published','Raman imaging',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000513',null,null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (514,'Published','fungus',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000514','Can be either unicellular or multicellular organisms that include yeasts, molds, and mushrooms. Several parasitic fungi exist that infect animals and plants, e.g., Aspergillus flavus, Claviceps purpurea, and Pneumocystis jirovecii.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (515,'Published','metazoan',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000515','Multicellular eukaryotic organisms that include those having a vertebral column (e.g., fish, frog, snake, bird, human) and those that do not (e.g., worm, fly, star fish, etc).',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (516,'Published','plant',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000516','Organisms that derive their energy from photosynthesis, with the exception of parasitic plants. Plants include herbs, shrubs, trees, grasses, vines, etc.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:38.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (517,'Published','protozoan',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000517','Single-celled organisms, some of which are parasitic. Examples include Plasmodium falciparum (causes malaria), Leishmania mexicana (causes leishmaniasis), and Trypanosoma brucei (causes sleeping sickness).',null,null,'Ready',0,{ts '2012-07-02 15:18:04.0'},{ts '2012-08-26 13:53:39.0'},'schatwin',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (518,'Published','gene knockdown by antisense RNA',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000518','Antisense RNA is a single-stranded RNA that is complementary to a messenger RNA (mRNA) strand transcribed within a cell. Antisense RNA may be introduced into a cell to inhibit translation of a complementary mRNA by base pairing to it and physically obstructing the translation machinery.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (519,'Published','gene knockdown by morpholino treatment',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000519','Method for reducing gene expression using morpholinos. Morpholino oligomers are an antisense technology used to block access of other molecules to specific sequences within nucleic acid. Morpholinos block small (~25 base) regions of the base-pairing surfaces of ribonucleic acid (RNA).',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (520,'Published','gene knockdown by RNA interference',null,'gene knockdown by RNAi','http://www.bard.nih.gov/ontology/bard#BARD_0000520','Method for introducing double-stranded RNA synthesized with a sequence complementary to a gene of interest into a cell or organism, where it is recognized as exogenous genetic material and activates the RNA interference (RNAi) pathway. Using this mechanism, researchers can cause a drastic decrease in the expression of a targeted gene.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'element','RDM request');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (521,'Published','gene overexpression by stable transfection',null,'overexp stable transfect','http://www.bard.nih.gov/ontology/bard#BARD_0000521',null,null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'free text','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (522,'Published','gene overexpression by transient transfection',null,'overexp transient transfect','http://www.bard.nih.gov/ontology/bard#BARD_0000522',null,null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'free text','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (523,'Published','mid-infrared imaging',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000523',null,null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (524,'Published','near-infrared imaging',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000524',null,null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (525,'Published','amino acid substitution',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000525','Mutation introduced into a gene of interest, where one or more amino acids are replaced by different ones to study the role of those amino acids in the function of the protein.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'free text','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (526,'Published','amino acid truncation',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000526','Mutation introduced into a gene of interest that either truncates the transcription of the gene or alters the gene expression so that the protein product is missing a portion of the protein towards the carboxyl-terminal. A truncated protein is generally non-functional.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (527,'Published','stable transfection method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000527','Technology in which the introduced plasmid construct is stably integrated in the cellular genome, and is therefore a permanent modification of the cells. This is achieved by selecting for cells that express a plasmid-encoded selectable marker, which is commonly an antibiotic resistance protein.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (528,'Published','transient transfection method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000528','Technology in which a gene or siRNA encoding DNA of interest is temporarily introduced into a cell using various plasmids. Usually, the transiently transfected DNA remains in the cell for 2-3 days and is functional, expressing the gene of interest. There are numerous transient transfection reagents and protocols available that have been optimized for various cell lines.',null,null,'Ready',0,{ts '2012-08-26 13:16:06.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (529,'Published','pathogenic virus transduction method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000529','Technology in which cells are infected with a disease-causing virus that could affect humans, animals, and plants. Examples of pathogenic viruses include the influenza virus, measles virus, and Japanese encephalitis virus.',null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (530,'Published','recombinant virus transduction method',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000530','Technology in which cells are infected with a modified virus that introduces a viral genome containing foreign genes. Several types of viruses are used for recombinant gene expression, including lentivirus, retrovirus, adenovirus, etc., and each has its own advantages and disadvantages.',null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (531,'Published','multicellular fungus',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000531','Fungus in which an individual organism consists of more than one cell. Most fungi are multicellular, and are made up of multicellular filaments known as hyphae. Several parasitic fungi exist, which infect animals and plants, such as Aspergillus flavus, Claviceps purpurea, and Pneumocystis jirovecii.',null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (532,'Published','unicellular fungus',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000532','Fungus in which an individual organisms consists of only one cell. This group includes the baker''s yeast (Saccharomyces cerevisiae) and fission yeast (Schizosaccharomyces pombe).',null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (533,'Published','gene knockdown by dsRNA transfection',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000533',null,null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (534,'Published','gene knockdown by lentiviral shRNA transduction',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000534',null,null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (535,'Published','gene knockdown by shRNA transfection',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000535',null,null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (536,'Published','gene knockdown by siRNA transfection',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000536',null,null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:39.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (537,'Published','invertebrate',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000537','Animals that lack a vertebral column. Many are used as model organisms in high throughput screening, including Drosophila, C. elegans, sea urchin, and others.',null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:40.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (538,'Published','vertebrate',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000538','Animals that have a vertebral column. Many are used as model organisms, including the zebrafish, mouse, and rat.',null,null,'Ready',0,{ts '2012-08-26 13:16:07.0'},{ts '2012-08-26 13:53:40.0'},'pclemons',null,'element','RDM request');
