INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (541,'Published','biology',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000541','Biological entity or process that is the presumed subject of the assay; may refer to a macromolecule whose activity is being regulated, or to a cell-biological process (e.g., neurite outgrowth). Refers specifically to the assay being defined without regard to the larger project context in which the assay may be executed; the larger project biological context is captured separately, in the project management section.',null,null,'Ready',1,{ts '2012-08-26 13:16:07.0'},{ts '2013-09-17 16:46:15.725'},'pclemons',null,'element','RDM request');
