INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (554,'Published','experiment panel name',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000555','Concept that groups multiple assay instances and allows description of a group of assays that measures more than one effect of a perturbagen. This allows prioritization by viewing the results together. A panel may be defined by a common assay method in which one variable such as the target is being changed (e.g., a selectivity panel of assays for activity against each member of a family of related proteins such as kinases.) A panel may also be defined as a set of distinct assay methods that are often run together by common practice (e.g., a panel of in vitro ADME assays).',null,null,'Ready',0,{ts '2012-08-26 13:16:08.0'},{ts '2012-08-26 13:53:40.0'},'pclemons',null,'free text','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (555,'Published','project information',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000556','Broader contextual information about related experiments; includes the overall goal of the project, such as "inhibitor probe for molecular process X" or "lead for treatment of disease Y."',null,null,'Ready',0,{ts '2012-08-26 13:16:08.0'},{ts '2012-08-26 13:53:40.0'},'pclemons',null,'element','RDM request');
