INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (624,'Published','robust z-prime factor',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000629','Defines the separation of the noise bands of the negative and positive controls in an experiment using robust statistics. The robust z'' is defined as 1-(3*(MAD(pos)-MAD(neg))/abs(median(pos)-median(neg)) where MAD(pos) is the median absolute deviation of the positive control population and MAD(neg) is the median absolute deviation of the negative control population. Typically defined on a per-plate basis but may be defined for an overall assay.',null,null,'Ready',0,{ts '2012-08-26 13:16:12.0'},{ts '2012-08-26 13:53:44.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (625,'Published','signal to noise ratio',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000630','Measure of signal strength. S/N=[Avg(poscontrol)-Avg(negcontrol)]/[StdDev(poscontrol)+StdDev(negcontrol)]',null,null,'Ready',0,{ts '2012-08-26 13:16:12.0'},{ts '2012-08-26 13:53:44.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (626,'Published','signal window',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000631','Difference of signal between positive and negative controls; assay dynamic range: SW={Avg(poscontrol)-Avg(negcontrol)-3x[StdDev(poscontrol)+StdDev(negcontrol)]}/StdDev(poscontrol).',null,null,'Ready',0,{ts '2012-08-26 13:16:12.0'},{ts '2012-08-26 13:53:44.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (627,'Published','z-factor',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000632','Describes the assay dynamic range considering range and data variation: Z=1-{3x[StdDev(sample)+StdDev(negcontrol)]/[Avg(sample)-Avg(negcontrol)]} Not to be confused with z-score.',null,null,'Ready',0,{ts '2012-08-26 13:16:12.0'},{ts '2012-08-26 13:53:44.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (628,'Published','z-prime factor',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000633','Defines the separation of the noise bands of the negative and positive controls in an experiment. The z'' is defined as 1-(3*(sigma(pos)-sigma(neg))/abs(mean(pos)-mean(neg)) where sigma(pos) is the standard deviation of the positive control population and sigma(neg) is the standard deviation of the negative control population. Typically defined on a per-plate basis but may be defined for an overall assay.',null,null,'Ready',0,{ts '2012-08-26 13:16:12.0'},{ts '2012-08-26 13:53:44.0'},'pclemons',null,'none','no');
