INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (648,'Published','physicochemical screen',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000653','Assay performed with the primary purpose of providing information that is of general interest to interpreting high-throughput screening results or relevant physicochemical properties, for example, in the context of identifying possible assay artifacts. Examples include fluorescence or solubility. Compound profiling is categorized as a stage, because it refers to the purpose of the assay. Profiling assays are typically independent from a screening campaign. Profiling assays performed as part of a campaign (on a limited set of compounds) would be considered secondary (typically counter screen) assays.',null,null,'Ready',2,{ts '2012-07-02 15:18:07.0'},{ts '2013-08-13 17:28:54.591'},'dlahr',null,'element','RDM request');
