INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (901,'Published','Bmax',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000876','It is the amount of drug required to saturate a population of receptors and a measure of the number of receptors present in the sample. It is derived from Scatchard plot of binding data. It is analogous to Vmax in enzyme kinetics.  The units of Bmax include cpm, sites/cell or fmol/mg. http://graphpad.com/curvefit/fitting_specific_binding_.htm',null,null,'Ready',0,{ts '2012-08-26 13:16:25.0'},{ts '2012-08-26 13:53:57.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (902,'Published','Kd',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000878','Kd ? is the equilibrium dissociation constant for a drug.  It describes the affinity between a ligand (L) (such as a drug) and a protein (P). Ligand-protein affinities are influenced by non-covalent intermolecular interactions between the two molecules such as hydrogen bonding, electrostatic interactions, hydrophobic and Van der Waals forces.  Kd = ([P] [L]) / [PL] The dissociation constant has molar units (M), which corresponds to the concentration of ligand [L] at which the binding site on a particular protein is half occupied, i.e. the concentration of ligand, at which the concentration of protein with ligand bound [PL], equals the concentration of protein with no ligand bound [P]. The smaller the dissociation constant, the more tightly bound the ligand is, or the higher the affinity between ligand and protein. http://www.graphpad.com/curvefit/law_of_mass_action.htm',null,null,'Ready',0,{ts '2012-08-25 16:06:18.0'},{ts '2012-08-26 13:53:57.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (903,'Published','Ki',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000879','Ki is the equilibrium inhibitor dissociation constant, the concentration of the competing inhibitor that results in binding to half the enzymes sites at equilibrium in the absence of substrate or other competitors. The Cheng and Prusoff equation: Ki - (IC50) / ( 1+ ([L]/Kd)) relates IC50 to Ki under conditions of competitive binding; Kd equilibrium dissociation constant of the (labeled) ligand, [L] ligand concentration. The Cheng and Prusoff equation: Ki - (IC50) / ( 1+ ([S]/Km)) relates IC50 to Ki under conditions of competitive inhibition; Ki equilibrium enzyme inhibitor dissociation constant; Km Michaelis-Menton constant, [S] substrate concentration.',null,null,'Ready',0,{ts '2012-08-25 16:06:18.0'},{ts '2012-08-26 13:53:57.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (904,'Published','kinetic constant',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000880','Describe kinetics of enzyme-catalyzed reactions. It includes the enzyme kinetic constants namely, Km and Vmax, which help to model the time course of disappearance of substrate and the production of product.',null,null,'Ready',0,{ts '2012-08-26 13:16:26.0'},{ts '2012-08-26 13:53:57.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (905,'Published','Vmax',1131,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000886','Vmax is defined as the maximum initial velocity of an enzyme catalyzed reaction under the given conditions, and it is measured in units of quantity of substrate transformed per unit time for a given concentration of enzyme.',null,null,'Ready',0,{ts '2012-08-26 13:16:26.0'},{ts '2012-08-26 13:53:57.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (906,'Published','Km',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000883','The concentration of substrate at ? Vmax, according to the Henri-Michaelis-Menten kinetic model.',null,null,'Ready',0,{ts '2012-08-26 13:16:26.0'},{ts '2012-08-26 13:53:57.0'},'pclemons',null,'none','no');
