INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (963,'Published','IC50',1078,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000938','The effective concentration of an inhibitor, which produces 50% of the maximum possible response for that inhibitor.',null,null,'Ready',0,{ts '2012-08-25 16:06:43.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (964,'Published','GI50',1078,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000930','The effective concentration of a growth inhibitor, which produces 50% of the maximum possible response for that inhibitor. GI50 is calculated from [(Ti-Tz)/(C-Tz)] x 100 = 50, where Tz is absorbance at time zero, Ti is absorbance in the presence of test drug, and C is absorbance in the control (untreated cells).  As a measure of viable or proliferating cells, different researchers measure different parameters, namely, protein content (by sulforhodamine B staining followed by absorbance measurement), mitochondrial dehydrogenase activity (by 3-(4,5-dimethylthiazol-2-yl)-2,5-diphenyl tetrasodium bromide, known as MTT staining followed by absorbance measurement), expression of proliferation associated antigens (by immunostaining for Ki-67), and ATP content (by using CellTiter-Glo reagent (Promega) followed by luminescence measurement).',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (965,'Retired','absolute IC50',1078,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000939','Absolute IC50 (calculated from the curve-fit function) is the concentration corresponding to exactly 50 percent inhibition. It is obtained from the curve fit function (back-calculated IC50) and can also be extrapolated. Commonly the relative IC50 is reported; however in cell proliferation assays absolute IC50 is often used. The absolute IC50 can be more reproducible.',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (966,'Retired','relative IC50',1078,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000943','The concentration of a test substance that produces an inhibitory effect corresponding to 50% of the activity of that particular substance (i.e. 50% of the difference between top and bottom of fitted curve). It can also be described as the concentration corresponding to the inflection point of the curve.',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (967,'Published','pIC50',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000942','pIC50 is -logIC50, where IC50 is the effective concentration of an inhibitor, which produces 50% of the maximum possible response for that inhibitor.',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (968,'Published','log IC50',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000941',null,null,null,'Ready',0,{ts '2012-08-25 16:06:04.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'none','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (969,'Published','IC80',1078,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000944','The effective concentration of an inhibitor, which produces 80% of the maximum possible response for that inhibitor.',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'numeric','no');
INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (970,'Published','TGI',1078,null,'http://www.bard.nih.gov/ontology/bard#BARD_0000934','TGI is total growth inhibition, which is the effective concentration of a growth inhibitor, which produces 0% relative growth for that inhibitor. Thus TGI signifies a cytostatic effect. tgi is calculated from [(Ti-Tz)/(C-Tz)] x 100 =0, where Ti = Tz and Tz is absorbance at time zero, Ti is absorbance in the presence of test drug, and C is absorbance in the control (untreated cells).  As a measure of viable cells, different researchers measure different parameters, namely, protein content (by sulforhodamine B staining followed by absorbance measurement), mitochondrial dehydrogenase activity (by 3-(4,5-dimethylthiazol-2-yl)-2,5-diphenyl tetrasodium bromide, known as MTT staining followed by absorbance measurement), and ATP content (by using CellTiter-Glo reagent (Promega) followed by luminescence measurement).',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:00.0'},'pclemons',null,'numeric','no');
