INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (977,'Published','Z-score',null,null,'http://www.bard.nih.gov/ontology/bard#BARD_0001099','Random and systematic error can induce either underestimation (false negatives) or overestimation (false positives) of measured signals. Z score indicates how many standard deviations an observation is above or below the mean. For calculating this, the average of the plate values is subtracted from individual raw values and the difference divided by the standard deviation estimated from all measurements of the plate.',null,null,'Ready',0,{ts '2012-08-26 13:16:29.0'},{ts '2012-08-26 13:54:01.0'},'pclemons',null,'none','no');
