INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (992,'Published','percent viability',1247,null,'http://www.bard.nih.gov/ontology/bard#BARD_0001081','It is a measure of living cells in a culture well. Unit of Measure is always % when normalized to the dynamic range of the assay. It can be estimated in the compound treated wells in comparison to vehicle-treated control wells and is expressed as a percent. Viability is determined by measuring tetrazolium salt and alamar blue reduction, staining with selective fluorescent dyes, or ATP content. ATP levels are detected using a luminescence based assay kit such as CellTiter-Glo (Promega). ATP values higher than controls indicate proliferation and cultures with ATP concentrations lower than controls indicates cytotoxicity. Percent viability = 100-percent cytotoxicity',null,null,'Ready',0,{ts '2012-08-25 16:06:36.0'},{ts '2012-08-26 13:54:01.0'},'pclemons',null,'numeric','no');
