INSERT INTO "ELEMENT" (ELEMENT_ID,ELEMENT_STATUS,LABEL,UNIT_ID,ABBREVIATION,BARD_URI,DESCRIPTION,SYNONYMS,EXTERNAL_URL,READY_FOR_EXTRACTION,VERSION,DATE_CREATED,LAST_UPDATED,MODIFIED_BY,CURATION_NOTES,EXPECTED_VALUE_TYPE,ADD_CHILD_METHOD) VALUES (1723,'Pending','Formazin Nephelometric Unit',null,'FNU','http://www.bard.nih.gov/ontology/bard#BARD_0001660','The most widely used measurement unit for turbidity is the FTU (Formazin Turbidity Unit). ISO refers to its units as FNU (Formazin Nephelometric Units).  There are several practical ways of checking water quality, the most direct being some measure of attenuation (that is, reduction in strength) of light as it passes through a sample column of water. The alternatively used Jackson Candle method (units: Jackson Turbidity Unit or JTU) is essentially the inverse measure of the length of a column of water needed to completely obscure a candle flame viewed through it. The more water needed (the longer the water column), the clearer the water. Of course water alone produces some attenuation, and any substances dissolved in the water that produce color can attenuate some wavelengths. Modern instruments do not use candles, but this approach of attenuation of a light beam through a column of water should be calibrated and reported in JTUs.',null,null,'Ready',0,{ts '2012-12-17 19:05:21.0'},{ts '2012-12-17 19:05:21.0'},'southern',null,'none','no');
